import { NgModule } from '@angular/core';
import { Routes, RouterModule } from '@angular/router';


const routes: Routes = [
  { path: '', redirectTo: '/dashboard', pathMatch: 'full' },
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }

import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'cypress-diary-app';
}

import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { Router } from '@angular/router';

@Injectable({
  providedIn: 'root'
})
export class EntryServiceService {

  constructor(private http: HttpClient, private router: Router) { }

  getEntries() {
    this.http.get('/api/v1/entries/list').subscribe((data: any) => {
      console.log('DATA: ', data);
    }, error => {
      console.log(error);
    });
  }
}

import { Component, OnInit } from '@angular/core';
import { EntryServiceService } from '../../services/entry-service.service';

@Component({
  selector: 'app-entries-list',
  templateUrl: './entries-list.component.html',
  styleUrls: ['./entries-list.component.scss']
})
export class EntriesListComponent implements OnInit {

  constructor(private entryService: EntryServiceService) { }

  ngOnInit() {
    this.entryService.getEntries();
  }

}

import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-view-entry',
  templateUrl: './view-entry.component.html',
  styleUrls: ['./view-entry.component.scss']
})
export class ViewEntryComponent implements OnInit {

  constructor() { }

  ngOnInit() {
  }

}

import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-create-entry',
  templateUrl: './create-entry.component.html',
  styleUrls: ['./create-entry.component.scss']
})
export class CreateEntryComponent implements OnInit {

  constructor() { }

  ngOnInit() {
  }

}

import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-dashboard',
  templateUrl: './dashboard.component.html',
  styleUrls: ['./dashboard.component.scss']
})
export class DashboardComponent implements OnInit {

  constructor() { }

  ngOnInit() {
  }

}

import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { DashboardComponent } from './components/dashboard/dashboard.component';
import { ViewEntryComponent } from './components/view-entry/view-entry.component';
import { EntriesListComponent } from './components/entries-list/entries-list.component';
import { CreateEntryComponent } from './components/create-entry/create-entry.component';

const routes: Routes = [
  { path: 'dashboard', component: DashboardComponent },
  { path: 'entries/view-entry/:id', component: ViewEntryComponent },
  { path: 'entries/list', component: EntriesListComponent },
  { path: 'entries/create-entry', component: CreateEntryComponent }
];

@NgModule({
  imports: [ RouterModule.forChild(routes) ],
  exports: [ RouterModule ]
})
export class DiaryEntriesRoutingModule { }

import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { HttpClientModule } from '@angular/common/http';
import { CommonModule } from '@angular/common';
import { EntriesListComponent } from './components/entries-list/entries-list.component';
import { ViewEntryComponent } from './components/view-entry/view-entry.component';
import { CreateEntryComponent } from './components/create-entry/create-entry.component';
import { DashboardComponent } from './components/dashboard/dashboard.component';
import { DiaryEntriesRoutingModule } from './diary-entries-routing.module';
import { EntryServiceService } from './services/entry-service.service';



@NgModule({
  declarations: [
    EntriesListComponent,
    ViewEntryComponent,
    CreateEntryComponent,
    DashboardComponent
  ],
  imports: [
    CommonModule,
    DiaryEntriesRoutingModule,
    BrowserModule,
    HttpClientModule
  ],
  providers: [
    EntryServiceService
  ]
})
export class DiaryEntriesModule { }

import { BrowserModule } from '@angular/platform-browser';
import { NgModule } from '@angular/core';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { DiaryEntriesModule } from './modules/diary-entries/diary-entries.module';
import { BrowserAnimationsModule } from '@angular/platform-browser/animations';

@NgModule({
  declarations: [
    AppComponent
  ],
  imports: [
    BrowserModule,
    DiaryEntriesModule,
    AppRoutingModule,
    BrowserAnimationsModule,
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }

// This file can be replaced during build by using the `fileReplacements` array.
// `ng build --prod` replaces `environment.ts` with `environment.prod.ts`.
// The list of file replacements can be found in `angular.json`.

export const environment = {
  production: false
};

/*
 * For easier debugging in development mode, you can import the following file
 * to ignore zone related error stack frames such as `zone.run`, `zoneDelegate.invokeTask`.
 *
 * This import should be commented out in production mode because it will have a negative impact
 * on performance if an error is thrown.
 */
// import 'zone.js/dist/zone-error';  // Included with Angular CLI.

import { enableProdMode } from '@angular/core';
import { platformBrowserDynamic } from '@angular/platform-browser-dynamic';

import { AppModule } from './app/app.module';
import { environment } from './environments/environment';

if (environment.production) {
  enableProdMode();
}

platformBrowserDynamic().bootstrapModule(AppModule)
  .catch(err => console.error(err));
